import React from 'react';
import {connect} from "react-redux";
import {conversation} from "../../_actions";
class ConversationItemHeader extends React.Component{
    constructor(props){
        super(props);
    }
    handleReply(e){
        this.props.dispatch(conversation.showComposeModal(true));
    }

    render() {
        return (
            <div className="conversation-item-header">
                <div className="conversation-item-title">
                    <h4 className="title">{this.props.userConversation.title}</h4>
                    <small className="time">{this.props.userConversation.created_at}</small>
                </div>

                <div className="conversation-item-action">
                    {this.props.userConversation.communication_type == 2 && <button type="button" className="btn btn-sm btn-info" onClick={e => this.handleReply(e)}>Reply <i  className="fa fa-arrow-right" aria-hidden="true"/></button>}
                </div>
            </div>
        );
    }
}

export default connect(state => state)(ConversationItemHeader);
